var title_f39_26_40364="High-risk patients with neutropenic fever";
var content_f39_26_40364=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F67027&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F67027&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Patients with neutropenic fever who are at high risk for serious complications",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Patients with",
"        <strong>",
"         any",
"        </strong>",
"        of the following characteristics are considered to be at high risk for serious complications during episodes of neutropenic fever:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Neutropenia (absolute neutrophil count &lt;500 cells/microL) anticipated to last &gt;7 days*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Presence of any comorbid medical problems, including, but not limited to:",
"        <ul>",
"         <li>",
"          Hemodynamic instability",
"         </li>",
"         <li>",
"          Oral or gastrointestinal mucositis that interferes with swallowing or causes severe diarrhea",
"         </li>",
"         <li>",
"          Gastrointestinal symptoms, including abdominal pain, nausea and vomiting, or diarrhea",
"         </li>",
"         <li>",
"          Neurologic or mental status changes of new onset",
"         </li>",
"         <li>",
"          Intravascular catheter infection, especially catheter tunnel infection",
"         </li>",
"         <li>",
"          New pulmonary infiltrate or hypoxemia",
"         </li>",
"         <li>",
"          Underlying chronic lung disease",
"         </li>",
"         <li>",
"          Complex infection at the time of presentation",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Alemtuzumab use within the past two months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Inpatient status at the time of development of fever",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Uncontrolled or progressive cancer",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Evidence of hepatic insufficiency (defined as aminotransferase levels &gt;5 times normal values) or renal insufficiency (defined as a creatinine clearance of &lt;30 mL/min)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Multinational Association for Supportive Care in Cancer (MASCC) risk index score &lt;21",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * The authors consider patients with an absolute neutrophil count &lt;500 cells/microL for &gt;7 days to be at high risk for serious complications. It should be noted that in the Infectious Diseases Society of America, the National Comprehensive Cancer Network, and the American Society of Clinical Oncology guidelines, patients with an absolute neutrophil count &le;100 cells/microL for &gt;7 days are considered to be at high risk for serious complications",
"     <sup>",
"      [1,2,3]",
"     </sup>",
"     .",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     Defined as any leukemic patient not in complete remission or a non-leukemic patient with evidence of disease progression after more than two courses of chemotherapy.",
"     <br/>",
"     &Delta; See the associated topic review for details about the MASCC risk index.",
"    </div>",
"    <div class=\"reference\">",
"     Data adapted from:",
"     <br/>",
"     <ol>",
"      <li>",
"       Freifeld AG, Bow EJ, Sepkowitz KA, et al. Clinical practice guideline for the use of antimicrobial agents in neutropenic patients with cancer: 2010 update by the Infectious Diseases Society of America. Clin Infect Dis 2011; 52:e56.",
"      </li>",
"      <li>",
"       National Comprehensive Cancer Network (NCCN) Clinical Practice Guidelines in Oncology. Prevention and treatment of cancer-related infections. Version 1.2012. file://www.nccn.org (Accessed on January 03, 2013).",
"      </li>",
"      <li>",
"       Flowers CR, Seidenfeld J, Bow EJ, et al. Antimicrobial prophylaxis and outpatient management of fever and neutropenia in adults treated for malignancy: American Society of Clinical Oncology clinical practice guideline. J Clin Oncol 2013.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
